DROP TABLE IF EXISTS `actividades_entregables`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `actividades_entregables` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `entregable` varchar(200) NOT NULL COMMENT 'descripción del entregable',
  `actividad_id` int(11) NOT NULL,
  `activo` int(11) NOT NULL DEFAULT 1 COMMENT '1=registro activo, 0=registro eliminado',
  `archivo_id` int(11) DEFAULT NULL COMMENT 'id del archivo',
  `usuario_id` int(11) DEFAULT NULL COMMENT 'id del usuario que crea el registro',
  `fecha_registro` timestamp NULL DEFAULT current_timestamp() COMMENT 'fecha de creacion del registro',
  `usuario_gestiona_id` int(11) DEFAULT NULL COMMENT 'id del usuario que carga el archivo',
  `fecha_gestiona` timestamp NULL DEFAULT NULL COMMENT 'fecha en que se carga el archivo',
  `usuario_valida_id` int(11) DEFAULT NULL COMMENT 'id del usuario que valida la informacion',
  `fecha_valida` timestamp NULL DEFAULT NULL COMMENT 'fecha en que se valida la informacion',
  `aprobado` tinyint(4) DEFAULT NULL COMMENT '1_aprobado 0=rechazado',
  `observaciones` varchar(100) DEFAULT NULL COMMENT 'observaciones porque aprueba o rechaza',
  PRIMARY KEY (`id`),
  KEY `actividades_entregables_actividades_id_fk` (`actividad_id`),
  CONSTRAINT `actividades_entregables_actividades_id_fk` FOREIGN KEY (`actividad_id`) REFERENCES `actividades` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=402 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

