  `centro_costo_id` int(11) DEFAULT NULL COMMENT 'id del centro de costo',
  `tipo_viaje` tinyint(4) DEFAULT NULL COMMENT '1=Nacional 2=Internacional',
  `via` tinyint(4) DEFAULT NULL COMMENT '1=Terrestre 2=Aereo 3=Fluvial 4=Maritimo',
  `empresa_viaje` varchar(200) DEFAULT NULL COMMENT 'id de la empresa de transporte',
  `tipo_cotizacion` tinyint(4) DEFAULT NULL COMMENT '1=Primera vez 2=Recotizacion',
  `ida_origen_id` int(11) DEFAULT NULL COMMENT 'id del sitio (aeropuerto) de origen',
  `ida_destino_id` int(11) DEFAULT NULL COMMENT 'ide del sitio de destino (aeropuerto)',
  `fecha_ida` date DEFAULT NULL COMMENT 'fecha de salida viaje de ida',
  `hora_ida` varchar(10) DEFAULT NULL COMMENT 'hora de salida ida',
  `obs_ida` varchar(100) DEFAULT NULL COMMENT 'observaciones viaje de ida',
  `regreso_origen_id` int(11) DEFAULT NULL COMMENT 'id del sitio (aeropuerto) de origen',
  `regreso_destino_id` int(11) DEFAULT NULL COMMENT 'ide del sitio de destino (aeropuerto)',
