  `hora_regreso` varchar(10) DEFAULT NULL COMMENT 'hora de regreso',
  `obs_regreso` varchar(100) DEFAULT NULL COMMENT 'observaciones del viaje de regreso',
  `fecha_vigencia` date DEFAULT NULL COMMENT 'fecha de vigencia de la cotizacion',
  `hora_vigencia` varchar(10) DEFAULT NULL COMMENT 'hora de vigencia de la cotizacion',
  `record` varchar(100) DEFAULT NULL COMMENT 'que es?',
  `estado` tinyint(4) NOT NULL DEFAULT 1 COMMENT '1=creada 2=guardada 3=aceptada 4=rechazada',
  `archivo_id` int(11) DEFAULT NULL COMMENT 'id del archivo pdf',
  `fecha_registro` timestamp NULL DEFAULT current_timestamp() COMMENT 'fecha de creacion del registro',
  `usuario_id` int(11) DEFAULT NULL COMMENT 'usuario que crea el registro',
  `activo` tinyint(4) DEFAULT 1,
  `obs_rechaza` varchar(200) DEFAULT NULL COMMENT 'motivo por el cual rechaza la cotizacion',
  `opcion_rechaza_id` tinyint(4) DEFAULT NULL COMMENT 'id del motivo por el que rechaza',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=latin1 COMMENT='Contiene las cotizaciones relacionadas con un visitador y una visita';
