CREATE TABLE `instituciones` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(300) NOT NULL COMMENT 'Nombre de la instucion (IES) o de la IPS, de acuerdo a lo que indica la columna tipo',
  `tipo` int(11) NOT NULL COMMENT '1=IES, 2=IPS, 3=OTRO',
  `programa` varchar(300) DEFAULT NULL COMMENT 'Nombre del programa, aplica obligatorio para IES ',
  `ciudad_id` int(11) NOT NULL COMMENT 'id de la ciudad',
  `direccion` varchar(300) DEFAULT NULL,
  `nivel_educacion_id` int(11) DEFAULT NULL COMMENT 'id de la tabla de nivel_educacion, aplica obligatorio para IES',
  `centro_costo_id` int(11) DEFAULT NULL COMMENT 'Id de la tabla de centro de costo (aplica obligatorio para IES)',
  `modalidad_id` int(11) DEFAULT NULL COMMENT 'Id de la tabla modalidad, aplica para IES, es opcional',
  `ampliacion` varchar(400) DEFAULT NULL COMMENT 'Dato de ampliación, aplica para IES, es opcional',
  `indicaciones_llegada` text DEFAULT NULL COMMENT 'Indicaciones de llegada a la sede, aplica opcional para IES',
  `sede` varchar(300) DEFAULT NULL COMMENT 'nombre de la sede, aplica obligatorio para IPS',
  `nombre_contacto` varchar(300) DEFAULT NULL COMMENT 'Nombre del contacto de la IPS',
  `cargo` varchar(300) DEFAULT NULL COMMENT 'Cargo aplica obligatorio para IPS',
  `email` varchar(100) DEFAULT NULL COMMENT 'email del contacto de la ips, aplica obligatorio para ips',
  `movil` varchar(20) DEFAULT NULL COMMENT 'Numero celular del contacto de la ips, es obligatorio para la ips',
  `telefono` varchar(20) DEFAULT NULL COMMENT 'telefono fijo del contacto de la ips, aplica obligatorio para IPS',
  `propedeuticos` varchar(200) DEFAULT NULL,
  `usuario_id` int(11) NOT NULL COMMENT 'id del usuario que creo el registro',
  `fecha_registro` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'fecha y hora de creacion del registro',
  PRIMARY KEY (`id`),
  KEY `ies_ips___fk2` (`centro_costo_id`),
  KEY `ies_ips___fk3` (`modalidad_id`),
  KEY `ies_ips_niveles_educacion_id_fk` (`nivel_educacion_id`),
  CONSTRAINT `ies_ips___fk2` FOREIGN KEY (`centro_costo_id`) REFERENCES `centros_costos` (`id`),
  CONSTRAINT `ies_ips___fk3` FOREIGN KEY (`modalidad_id`) REFERENCES `modalidades` (`id`),
  CONSTRAINT `ies_ips_niveles_educacion_id_fk` FOREIGN KEY (`nivel_educacion_id`) REFERENCES `niveles_educacion` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=136 DEFAULT CHARSET=latin1;
