DROP TABLE IF EXISTS `planillas_novedades`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `planillas_novedades` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id consecutivo de la planilla',
  `tipo_planilla_id` int(11) NOT NULL COMMENT 'de acuerdo a la tabla tipo_planilla_id',
  `nombre_negocio` varchar(100) CHARACTER SET latin1 DEFAULT NULL COMMENT 'Nombre del negocio (control fiduciaria)',
  `nombre_cuenta` varchar(100) CHARACTER SET latin1 DEFAULT NULL COMMENT 'nombre de la empresa (control fiduciaria)',
  `no_contrato` varchar(20) CHARACTER SET latin1 DEFAULT NULL COMMENT 'Numero de contrato (control fiduciaria)',
  `banco_id` int(11) DEFAULT NULL COMMENT 'id del banco',
  `tipo_cuenta_id` int(11) DEFAULT NULL COMMENT '1= ahorros 2=corriente Tipo de cuenta bancaria (control fiduciaria)',
  `no_cuenta` varchar(50) CHARACTER SET latin1 DEFAULT NULL COMMENT 'Numero de cuenta bancaria (control fiduciaria)',
  `centro_costo_id` int(11) DEFAULT NULL COMMENT 'id del centro de costo',
  `no_orden_pago` varchar(20) CHARACTER SET latin1 DEFAULT NULL COMMENT 'numero de orden de pago',
  `proyecto_id` int(11) DEFAULT NULL COMMENT 'id del proyecto',
  `valor` decimal(10,2) DEFAULT NULL COMMENT 'Valor de la planilla',
  `fecha_planilla` date DEFAULT NULL COMMENT 'fecha de generacion de la planilla',
  `numero_pagos` int(11) DEFAULT NULL COMMENT 'Cantidad de visitadores de la planilla',
  `estado` tinyint(4) DEFAULT NULL COMMENT '1=En construccion 2=En validacion 3=Aprobada 4=Rechazada 5=no aprobada',
  `obs_rechaza` varchar(100) CHARACTER SET latin1 DEFAULT NULL COMMENT 'informacion sobre porque rechaza la planilla',
  `obs_no_aprueba` varchar(300) COLLATE latin1_nopad_bin DEFAULT NULL COMMENT 'informacion o motivos por los que no aprueba',
  `usuario_id` int(11) DEFAULT NULL COMMENT 'usuario que crea el registro',
  `fecha_revisar` date DEFAULT NULL COMMENT 'fecha revisar antes de',
  `fecha_registro` timestamp NULL DEFAULT NULL COMMENT 'fecha de creacion del registro',
  `activo` tinyint(4) DEFAULT NULL COMMENT '1=activo 0=eliminado',
  `usuario_valida_id` int(11) DEFAULT NULL COMMENT 'id del usuario que valida la planilla',
  `fecha_validacion` timestamp NULL DEFAULT NULL COMMENT 'fecha de validacion de la planilla',
  `fecha_actualizacion` timestamp NULL DEFAULT NULL COMMENT 'fecha y hora de la ultima actualizacion. Se ordena por este campo',
  `fecha_aprobacion` timestamp NULL DEFAULT NULL COMMENT 'fecha y hora de aprobacion de la planilla',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 COLLATE=latin1_nopad_bin COMMENT='Contiene los registro de planillas de novedades';
