DROP TABLE IF EXISTS `vigilados`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `vigilados` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Id vigilado',
  `nombre` varchar(300) COLLATE latin1_spanish_ci NOT NULL COMMENT 'Nombre de la empresa',
  `nit` varchar(100) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Nit de la empresa',
  `proyecto_id` int(11) DEFAULT NULL,
  `no_contrato` varchar(100) COLLATE latin1_spanish_ci NOT NULL COMMENT 'Numero de contrato',
  `telefono` varchar(100) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Telefono principal del vigilado',
  `no_cert_presupuestal` varchar(100) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Numero de certificado presupuestal',
  `valor` double NOT NULL COMMENT 'Valor del contrato, hay que aceptar decimales',
  `fecha_inicio` date NOT NULL COMMENT 'Fecha de inicio del contrato del vigilado',
  `fecha_fin` date NOT NULL COMMENT 'Fecha fin del contrato del vigilado',
  `acta_inicio` varchar(20) COLLATE latin1_spanish_ci DEFAULT NULL,
  `ciudad_id` int(11) NOT NULL COMMENT 'Id ciudad principal del vigilado',
  `direccion` varchar(300) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Dirección principal de la empresa',
  `supervisor` varchar(300) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Nombre del supervisor del vigilado',
  `representante` varchar(300) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Nombre del representante legal',
  `tipo_doc_representante` tinyint(4) DEFAULT NULL,
  `cedula_representante` varchar(100) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Cedula del representante legal del vigilado',
  `email_representante` varchar(100) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Email del representante legal del vigilado',
  `telefono_representante` varchar(20) COLLATE latin1_spanish_ci DEFAULT NULL,
  `director` varchar(300) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Nombre del director del vigilado',
  `tipo_doc_director` tinyint(4) DEFAULT NULL,
  `cedula_director` varchar(100) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Cedula del director del vigilado',
  `email_director` varchar(100) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Email del director del vigilado',
  `telefono_director` varchar(20) COLLATE latin1_spanish_ci DEFAULT NULL,
  `activo` tinyint(1) NOT NULL DEFAULT 1 COMMENT '0 registro inactivo, 1 registro activo',
  `usuario_id` int(11) DEFAULT NULL,
  `fecha_registro` datetime DEFAULT current_timestamp(),
  `fijo` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0 cuando el registro sea editable 1 cuando no (ejemplo de 1: interventorias).',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=latin1 COLLATE=latin1_spanish_ci;
