DROP TABLE IF EXISTS `visitas_visitadores`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `visitas_visitadores` (
  `visita_id` int(11) NOT NULL,
  `visitador_id` int(11) NOT NULL,
  `requiere_tiquetes` tinyint(4) DEFAULT 0 COMMENT '0=no 1=si requiere tiquetes',
  `observaciones` varchar(200) DEFAULT NULL COMMENT 'observaciones de la asignacion visitador',
  `rol_par_id` int(11) DEFAULT NULL COMMENT 'rol del par en la visita',
  `dias_gastos_viaje` decimal(4,2) DEFAULT NULL COMMENT 'cantidad de dias ',
  `valor_dia` decimal(10,2) DEFAULT NULL COMMENT 'valor de un dia de gastos',
  `valor_porcion` decimal(10,2) DEFAULT NULL COMMENT 'valor de una porcion del total',
  `valor_total` decimal(10,2) DEFAULT NULL COMMENT 'valor total de gastos',
  `fecha_registro` timestamp NULL DEFAULT NULL COMMENT 'fecha y hora de creacion del registro',
  `usuario_id` int(11) DEFAULT NULL COMMENT 'id dle usuario que crea el registro',
  `activo` tinyint(4) DEFAULT 1 COMMENT '0=eliminado 1=activo',
  `estado` tinyint(4) DEFAULT 1 COMMENT '1=creado 2=finalizado',
  `obs_elimina` varchar(100) DEFAULT NULL COMMENT 'motivo por el cual elimina el registro de visitador visita',
  `opcion_elimina_id` tinyint(4) DEFAULT NULL COMMENT 'de acuerdo a tabla opciones_elimimar',
  PRIMARY KEY (`visita_id`,`visitador_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

